package com.saraya.service;

import java.util.ArrayList;
import java.util.Iterator;
import java.util.List;

import com.saraya.model.Plane;


public class PlaneService {


	private static ArrayList<Plane> planes=new ArrayList<Plane>();
	private static int count=4;
	
	static {
		planes.add(new Plane(1,2019,"BOEING ","737 MAX ",(float)105.0,"data:image/jpeg;base64, "));
		planes.add(new Plane(2,2021,"Airbus","A380",(float)108.0,"https://emag.directindustry.com/wp-content/uploads/sites/3/A380-family-stage.jpg "));
		planes.add(new Plane(3,2022,"BOEING","747-200B",(float)101.0," https://www.airlineratings.com/wp-content/uploads/uploads/Qantas-747-238.jpg"));
		planes.add(new Plane(4,2014,"Nextant","400XTi",(float)50.0,"data:image/jpeg;base64, "));
		
	}
	
	public List<Plane> getAllPlanes(){
		return planes;
	}
	public void addPlane(int year, String make, String model,float length,String image) {
		planes.add(new Plane(++count,year,make,model,length,image));
	}
	public void deletePlane(int id) {
		Iterator<Plane> iterate=planes.iterator();
		while(iterate.hasNext()) {
			Plane plane=iterate.next();
			if(plane.getId()==id) {
				iterate.remove();
			}
		}
	
	}
}
